requests.postData:
{"query":"{
        craftingRecipes(first:1000,where:{status:VALID}){
          id
          name
          displayName
          recipeType
          zugCost
          boneShardCost
          status
          inputs(first:1000) {
            index
            id
            isRequired
            options(first:1000){
              item{
                id
                itemId
                name
                description
              }
              id
              amount
            }
          }
          outputs{
            options{
              item{
                id
                itemId
                name
                image{
                  image
                }
                itemProperties{
                  name
                  value
                }
              }
            }
          }
        }
      }"}

